import React from 'react';

function Education() {
    return ( 
      <div className='container mt-5 mb-5'>
        <div className='row'>
            <div className='col-5'>
                <img src='media/images/education.svg' alt='Ecosystem'></img>
            </div>
            <div className='col-1'></div>
            <div className='col-6'>
                <h2></h2>
            </div>
        </div>
      </div>
     );
}

export default Education;
